import {gql} from "apollo-boost";

export const CountryQuery = gql`
    query country($ID: !ID) {
        country(code: $ID) {
          code
          name
          native
          phone
          continent{
                code
                name
            }
          capital
          currency
          languages{
            code
            name
          }
          emoji
           
        }
    }
`;
